import React, { Component }from 'react';
import styled from 'styled-components';


import ProjectList from "../list_projects_page/ProjectList"
import ProjectFilters from "../list_projects_page/ProjectFilters"

const ContentWrap = styled.div`

 flex:auto;
 justify-items:center;
 background-color: #efefef;
 h1{
     color:red;
 }

`

class Content extends Component{
    render() {

        return (
            <h1>Content</h1>
            // <ContentWrap>
            //     <ProjectList/>
            //     <ProjectFilters/>
            // </ContentWrap>
        )

    }
}

export default Content
